import React from 'react';
import './Navbar.css'; // Import the CSS for styling

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">
        <a href="/">MySite</a> {/* Change to <Link to="/">MySite</Link> if using React Router */}
      </div>
      <ul className="nav-links">
        <li>
          <a href="/about">About</a> {/* Change to <Link to="/about">About</Link> if using React Router */}
        </li>
        <li>
          <a href="/services">Services</a> {/* Change to <Link to="/services">Services</Link> */}
        </li>
        <li>
          <a href="/contact">Contact</a> {/* Change to <Link to="/contact">Contact</Link> */}
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
